import React from 'react';

function NavBar()
{
    return(
        <div>
            <ul className="nav-links">
                <a href='/'>
                    <li>Main</li>
                </a>
                <a href='/login'>
                    <li>Login</li>
                </a>
            </ul>
        </div>
    );
}

export default NavBar;
